import Header from './Header';
import Canvas from './Canvas';

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'
};

const Layout = props => (
  <div style={layoutStyle}>
    <Header />
    {props.children}
    <Canvas />
  </div>
);

export default Layout;
